import React from "react";
import {BrowserRouter as Router, Route, Routes, Link} from 'react-router-dom'
import { Helmet } from 'react-helmet';


import './App.css';
import Vector from './components/Vector/Vector.jsx';
import Home from './Pages/Home';
import Input from './components/Input/Input';


function App() {
  const [email, setEmail] = useState();
  const [password, setPassword] = useState();
  const [emailDirty, setEmailDirty] = useState();
  const [passwordDirty, setPasswordDirty] = useState();
  const [emailError, setEmailError] = useState();
  const [passwordError, setPasswordError] = useState();

  return(
    <div>
      <Helmet>
        <title>Вход</title>
      </Helmet>
      <div className="link__container">
        <Link className="link" to="/home">Главная</Link>
      </div>
      <form>
        <div className="form">
          <h1>Вход</h1>
          <Input mainCN="input_form" cN='form_input' name="email" type="text" placeHolder="Логин"/>
          <Input mainCN="input_form" cN='form_input' name="password" type="password" placeHolder="Пароль"/>
          <div className="form-button">
            <button type="submit">Войти</button>
          </div>
        </div>
      </form>
    </div>
  )
}

function Routering () {


  return(
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/home" element={<Home />}/>
          <Route exact path="/" element={<App />} />
        </Routes>
      </Router>
      <Vector />
    </div>
  )
}

export default Routering;
